                  notificationBody:
                    "<div>Appeal reference: TestAsylumCase\n\nThe Home Office has reviewed your appeal and decided to maintain their decision to refuse your application to stay in or enter the UK. The Home Office has sent a document to the Tribunal called the Home Office Response. This includes the reasons the Home Office still think they were correct to refuse your application. Sign in to your account to read the Home Office Response.\n\nhttps://www.appeal-immigration-asylum-decision.service.gov.uk/\n\nThe Tribunal will contact you by 29 Sep 2025 to tell you what to do next. If there is something you don't agree with in the Home Office Response you can send this information to the Tribunal. Use the 'Provide more evidence' link on your appeal page to do this.</div>",
