                  notificationBody:
                    "<div>Appeal reference: TestAsylumCase<br>Home Office reference: 007393204<br><br>Dear Donaven Tjimbapeua Friedhaem Kaura,<br><br>A Tribunal Caseworker has sent your appeal to the Home Office. The Home Office will now review their decision to refuse your application to stay in or enter the UK.<br><br>#What happens next?<br>The Home Office will look at all the information and evidence you sent to the Tribunal and will either:<br><br>*withdraw their decision<br>*maintain their decision<br><br>#What does 'withdraw their decision' mean?<br>This means the Home Office has looked at all the information and evidence you sent to the Tribunal and decided to look again at their decision to refuse your application to stay in or enter the UK.<br><br>#What does 'maintain their decision' mean?<br>This means the Home Office has looked at all the information and evidence you sent to the Tribunal but still think they were correct to refuse your application to stay in or enter the UK. The appeal will continue and will be decided by a Tribunal judge.<br><br>#More information<br>Sign in to your account to read more about what happens if the Home Office withdraw or maintain their decision. <br><br>https://www.appeal-immigration-asylum-decision.service.gov.uk/<br><br>---<br>#How to contact the Tribunal<br>Telephone: 0300 123 1711<br>Monday to Friday, 8:30am to 5pm<br>Find out about call charges: https://www.gov.uk/call-charges<br>Email: contactia@justice.gov.uk<br><br>This is an automated message. Please do not reply to this email.</div>",
